The Hellacopters were a Swedish rock band that was formed in 1994 and disbanded October 26 2008. They have released six full length albums of their own material, a cover album, two compilations of non album work, six EPs, and many other official releases. In October of 2007 the band officially announced their break up after an extensive European tour and the release of a double disc live album. The band was, together with The Hives, one of the most important Swedish bands in the garage rock revival and one of the most influential rock bands in Sweden.




